import React from 'react'
import Typist from 'react-typist';
import ForumIcon from '@material-ui/icons/Forum';
function Home() {
    return (
        <div className='homeContainer'>
            <div>
                <ForumIcon />
            </div>
            <Typist cursor={
                {
                    hideWhenDone: true
                }
            }>
                <span> Welcome To Magic Chat Application.</span>
                <Typist.Delay ms={500} />
                <br />
                <br />
                <span>Developed By Nishant Rana.</span>
            </Typist>
        </div >
    )
}

export default Home
